import { useCallback } from 'react';
import ReactFlow, {
  Background,
  Controls,
  MiniMap,
  addEdge,
  useNodesState,
  useEdgesState,
} from 'reactflow';
import 'reactflow/dist/style.css';

import LyricsInputNode from './components/LyricsInputNode';
import TextToTextNode from './components/TextToTextNode';
import TextSplitterNode from './components/TextSplitterNode';
import StyleImageGenNode from './components/StyleImageGenNode';
import ImageToVideoNode from './components/ImageToVideoNode';

import './App.css';

// Register custom node types
const nodeTypes = {
  lyricsInput: LyricsInputNode,
  textToText: TextToTextNode,
  textSplitter: TextSplitterNode,
  styleImageGen: StyleImageGenNode,
  imageToVideo: ImageToVideoNode,
};

// Initial nodes
const initialNodes = [
  {
    id: '1',
    type: 'lyricsInput',
    position: { x: 50, y: 50 },
    data: {},
  },
  {
    id: '2',
    type: 'textToText',
    position: { x: 420, y: 80 },
    data: {},
  },
  {
    id: '3',
    type: 'textSplitter',
    position: { x: 780, y: 100 },
    data: {},
  },
  {
    id: '4',
    type: 'textToText',
    position: { x: 420, y: 380 },
    data: {},
  },
  {
    id: '5',
    type: 'styleImageGen',
    position: { x: 1100, y: 120 },
    data: {},
  },
  {
    id: '6',
    type: 'imageToVideo',
    position: { x: 1500, y: 100 },
    data: {},
  },
];

// Initial edges
const initialEdges = [
  {
    id: 'e1-2',
    source: '1',
    target: '2',
    sourceHandle: 'text',
    targetHandle: 'text',
    animated: true,
    label: 'text',
    style: { stroke: '#86efac' },
  },
  {
    id: 'e2-3',
    source: '2',
    target: '3',
    sourceHandle: 'text',
    targetHandle: 'text',
    animated: true,
    label: 'text',
    style: { stroke: '#86efac' },
  },
  {
    id: 'e1-4',
    source: '1',
    target: '4',
    sourceHandle: 'text',
    targetHandle: 'text',
    animated: true,
    label: 'text',
    style: { stroke: '#86efac' },
  },
  {
    id: 'e3-5',
    source: '3',
    target: '5',
    sourceHandle: 'text1',
    targetHandle: 'text',
    animated: true,
    label: 'text',
    style: { stroke: '#86efac' },
  },
  {
    id: 'e5-6',
    source: '5',
    target: '6',
    sourceHandle: 'image',
    targetHandle: 'image',
    animated: true,
    label: 'image',
    style: { stroke: '#93c5fd' },
  },
];

function App() {
  const [nodes, setNodes, onNodesChange] = useNodesState(initialNodes);
  const [edges, setEdges, onEdgesChange] = useEdgesState(initialEdges);

  const onConnect = useCallback(
    (params) => setEdges((eds) => addEdge(params, eds)),
    [setEdges]
  );

  return (
    <div className="react-flow-container">
      <ReactFlow
        nodes={nodes}
        edges={edges}
        onNodesChange={onNodesChange}
        onEdgesChange={onEdgesChange}
        onConnect={onConnect}
        nodeTypes={nodeTypes}
        defaultZoom={0.8}
        minZoom={0.2}
        maxZoom={2}
        fitView
      >
        <Background patternColor="#e5e7eb" gap={16} />
        <Controls />
        <MiniMap />
      </ReactFlow>
    </div>
  );
}

export default App;
